INSERT INTO `cadrelatorios` VALUES (1,'ServIP','select \r\n  cis.chave as CI, \r\n  tipocis.tipo,cis.descricao as Descricao,\r\n  sites.nome as Site, \r\n  atributos.valor as IP \r\nfrom cis, \r\n  atributos,\r\n  sites,\r\n  tipocis \r\n\r\nwhere \r\n   (atributos.dicdado_id = 6 or atributos.dicdado_id=10) and \r\n    atributos.ci_id = cis.id and \r\n    cis.site_id = sites.id and \r\n    cis.tipoci_id = tipocis.id \r\n\r\norder by atributos.valor;','2013-04-18 01:03:13','2013-08-21 19:35:51','Serv Virtuais e IPs'),(2,'AlertasCWBGestor','select  \r\n  sites.nome as Site,\r\n  categories.name as \"Cliente\",\r\n  DATE_FORMAT(tasks.created_at, \'%d-%m\')  as \"Criando em \",\r\n  status as Status,\r\n\r\n  tipotask as tipo,\r\n  fornecedores.nome as Fornecedor, \r\n  concat(tasks.nome,\"-\",tasks.description) as Alerta \r\nfrom \r\n   tasks,\r\n   fornecedores,\r\n   sites,\r\n   categories\r\nwhere site_id in (1,4,7) and \r\n   publica and \r\n   fornecedores.id = tasks.fornecedor_id and \r\n   categories.id = tasks.category_id and\r\n   sites.id = tasks.site_id and \r\n   tasks.ativo=1','2013-04-19 13:55:28','2013-08-09 15:04:43',''),(3,'TodosLinks','Select contratos.codcontrato ,fornecedores.nome, contratos.valormensal from contratos, fornecedores where tipocontrato_id=3 and contratos.fornecedor_id = fornecedores.id','2013-05-20 17:26:32','2013-05-20 17:29:29',NULL),(4,'EmMudanca','select cis.chave as CI, statuscis.status as Status, tipocis.tipo,cis.descricao as Descricao from cis, statuscis,tipocis where \r\ncis.statusci_id in(3,4,6) and cis.tipoci_id = tipocis.id \r\nand cis.statusci_id = statuscis.id','2013-06-10 13:29:12','2013-06-10 13:34:52',NULL),(5,'ServidoresXServicos','select\r\n        cis.chave as CI,\r\n        cis.owner as Email,\r\n        cis.descricao as Descricao,\r\n        MAX(IF(atributos.dicdado_id = 9, atributos.valor, NULL)) as Servicos ,\r\n        MAX(IF(atributos.dicdado_id = 27, atributos.valor, NULL)) as \"Data Liberacao\" ,\r\n        MAX(IF(atributos.dicdado_id = 26 , atributos.valor, NULL)) as SO\r\n    from\r\n        cis,\r\n        atributos,\r\n        sites,\r\n        tipocis\r\n     where\r\n        cis.tipoci_id=32 and\r\n        atributos.ci_id = cis.id and\r\n        cis.site_id = sites.id and\r\n        cis.tipoci_id = tipocis.id\r\n      group by\r\n        cis.chave\r\n      order by\r\n        cis.chave;','2013-06-14 14:24:29','2013-06-14 14:43:52',NULL),(6,'Links','select\r\n        cis.chave as CI,\r\n        cis.descricao as Descricao,\r\n        MAX(IF(atributos.dicdado_id = 3, atributos.valor, NULL)) as Designacao \r\n    from\r\n        cis,\r\n        atributos,\r\n        \r\n        tipocis\r\n     where\r\n        cis.tipoci_id=14 and\r\n        atributos.ci_id = cis.id and\r\n        cis.descricao like \'%level3%\' and\r\n        cis.tipoci_id = tipocis.id\r\n       \r\n      group by\r\n        cis.chave\r\n      order by\r\n        cis.chave;','2013-06-19 18:33:10','2013-06-19 19:38:14','Links com designacao'),(7,'Contratos','select concat_ws(\',\',c.codcontrato, \r\nifnull( c.descricao,\'\'),  \r\nifnull( c.datainicio,\'\'),  \r\nifnull( c.datafim,\'\'),  \r\nifnull( c.datarenovacao,\'\'), \r\nifnull( c.projetoCCTI,\'\'), \r\nifnull( c.projetoCCArea,\'\'),  \r\nifnull( c.classificacao,\'\') ,\r\nifnull( f.nome,\'\'),\r\nifnull( tc.descricao, \'\')\r\n\r\n\r\n)\r\n\r\nfrom contratos c, fornecedores f,tipocontratos tc where c.tipocontrato_id = tc.id and c.fornecedor_id = f.id;\r\n','2013-07-16 16:10:51','2013-07-16 16:21:25','relação de todos os contratos'),(8,'Alertas_BV_VO','select  \r\n  sites.nome as Site,\r\n  categories.name as \"Cliente\",\r\n  DATE_FORMAT(tasks.created_at, \'%d-%m\')  as \"Criando em \",\r\n  status as Status,\r\n\r\n  tipotask as tipo,\r\n  fornecedores.nome as Fornecedor, \r\n  concat(tasks.nome,\"-\",tasks.description) as Alerta \r\nfrom \r\n   tasks,\r\n   fornecedores,\r\n   sites,\r\n   categories\r\nwhere site_id in (1,2,5) and \r\n   publica and \r\n   fornecedores.id = tasks.fornecedor_id and \r\n   categories.id = tasks.category_id and\r\n   sites.id = tasks.site_id and \r\n   tasks.ativo=1','2013-08-09 15:05:24','2013-08-09 15:09:07',''),(9,'Links cristiano','Select \r\n  cis.descricao, \r\n  sites.nome, \r\n    MAX(IF(atributos.dicdado_id = 1, atributos.valor, NULL)) as Banda\r\n\r\nfrom cis , sites, atributos\r\nwhere  \r\n \r\n owner like \'%cristiano%\' and\r\n cis.site_id = sites.id and\r\n atributos.ci_id = cis.id and\r\n cis.tipoci_id=14\r\n\r\n\r\n\r\n','2013-08-21 19:27:04','2013-08-21 19:45:51','');
