rdlock. \r\n\r\nEssa manutenção será feita pelos analista abaixo.\r\n\r\nRM: Marcelo Garcia EMail:msgouza@brq.com Ramal:8900\r\nData Center: Darci Farias Email:dfarias@brq.com Ramal:9897\r\n','Resolvido',23,1,5,1,'2013-07-12 14:01:11','2013-07-16 19:54:19',0,NULL,'','[Manutenção Servidor RM]',47,'',1,'Info',NULL,''),(804,'A MPLS do Rio esta muito sobrecarregada deste o inicio do dia impactando vários serviços.\r\n\r\nIdentificamos também que o trafego maior esta entre Rio e Curitiba partindo do servidor rjserver159 (Office Scan) para varias estações em CWB \r\n\r\nComo solução paliativa o servidor foi desligado conforme combinado com o responsável pelo mesmo.\r\n\r\n\r\nSegue a evidencia do trafego','Normalizado',23,1,5,3,'2013-07-12 18:24:42','2013-07-17 22:22:37',0,NULL,'','[Degradação MPLS rio de janeiro]',47,'',0,'Incidente',NULL,''),(805,'Devido a preparação para instalação do novo link da Cielo, toda a rede de Murano ficará indisponível no domingo, 14/07, das 20hs às 22hs.','Executado com Sucesso',6,1,5,11,'2013-07-12 19:45:01','2013-07-16 19:40:27',0,NULL,'','Manutenção Rede]',47,'',0,'Mudança',NULL,''),(806,'Área responsável realizando as devidas verificações relacionado ao licenciamento dos servidores dedicados ao VDI Itaú.','Normalizado',23,1,4,1,'2013-07-15 14:33:35','2013-07-23 20:24:03',0,NULL,'','[Instabilidade] VDI Itaú.',47,'',0,'Incidente',NULL,'Realizado reparo nos servidores com problemas de licença, aplicação continua em análise.'),(807,'Notificado ao suporte local de BV.','Resolvido',23,1,4,5,'2013-07-15 14:43:48','2013-07-17 22:21:16',0,NULL,'','[Alerta] Wireless.BV.3 - 2º Andar.central',47,'',0,'Incidente',NULL,''),(808,'Servidor apresentando 5% livre. Notificada a área responsável.\r\n','Aberto',1,1,4,2,'2013-07-15 15:47:01','2013-07-16 19:56:24',0,NULL,'','[Alerta] spserver248.Book.Financenceiro.Disco.D',47,'',0,'Info',NULL,''),(809,'Estamos recebendo reclamações dos colaboradores em relação a uma degradação no ambiente Panamérica Park volta