\nLink Cielo\r\nLink Citibank\r\nTelfonia\r\n\r\nUma nova janela será agendada'),(813,'16:00hrs Serviço de Internet normalizado, ocorreu um erro de configuração na própria operadora.\r\n\r\n15:03Hs - Feedback - A engenharia da GVT já está trabalhando para resolver o problema, não foi informado prazo.\r\n-----------------------------------------------------------\r\n14:48Hs - Falha massiva constatada e o gerente de contas foi acionado.\r\n\r\nAguardamos feedback do mesmo.\r\n-----------------------------------------------------------\r\n14:11Hs - Estamos recebendo alguns alertas relativos ao Link Gmail GVT.\r\n\r\nJá estamos em contato com a operadora analisando o link.','Resolvido',23,1,4,4,'2013-07-17 17:32:16','2013-07-22 17:28:25',0,NULL,'','[Serviço Internet Marechal/Kennedy]',4,'',1,'Incidente',NULL,''),(814,'E-mail notificando a área responsável:\r\n\r\nEstamos recebendo dois alertas em nosso painel de monitoração, todos os nossos links estão operando em sua normalidade.\r\n\r\nO ambiente Cielo está sofrendo impacto neste momento? Conseguimos um canal direto para interação relacionado aos servidores da própria Cielo?\r\n\r\nVIS.Cielo - Via Murano   Host: 10.50.52.51 Port: 1433\r\n\r\nMainframe SEC.Homologação 1.Cielo - Via Murano   Host: 10.90.7.122  Port 992','Resolvido',23,1,4,11,'2013-07-18 11:51:59','2013-07-23 20:23:25',0,NULL,'','[Alarmes] Vis.Cielo / Mainframe Sec. Homologação',47,'',0,'Info',NULL,'Problema de configuração, falta de rotas na localidade; '),(815,'Manutenção no SAP Produção para ajustes de bkp via sqlserver \r\n\r\nA manutenção acontecerá HOJE das 20hs às 21:30 ','Executado com Sucesso',2,1,5,1,'2013-07-18 17:23:45','2013-07-22 13:40:34',0,NULL,'','[Manutenção SAP Produção]',47,'',0,'Info',NULL,''),(816,'19/07/2013 \r\nRealizei o contato junto a operadora e após análise, recebi o retorno que o nosso circuito foi afetado por uma degradação de fibra.\r\n\r\nIncidente gerado devido a uma falha no backbone da level (3) entre SP e Rio, como o circuito da BRQ possuí proteção, ocorreu uma conversão para outro Anel causando uma oscilação momentânea, porém mantendo o nosso serviço disponível.\r\n\r\n\r\n\r\n-Hoje pela manhã sofremos com uma oscilação no link de MPLS entre 10:40 as 10:50h.\r\nEstamos com um chamado aberto junto a operadora, foi identificada uma oscilação, estamos no aguardo da análise dos logs.','Resolvido',23,1,4,2,'2013-07-18 19:12:39','2013-07-23 20:25:51',0,NULL,'','[Incidente] Oscilação MPLS.',23,'6818640',1,'Incidente',NULL,'servicedesknmpt por  brq.com \r\n18:12 (17 minutos atrás)\r\n\r\npara ale, noc, nsantos, djunqueira, leandrocaron, dc, Bruno, Jacquelline, Mauricio \r\nPrezado cliente,\r\n \r\nDetectamos um alerta e efetuamos a abertura de um incidente para a localidade BRQ - São Paulo - Dados:\r\n \r\nINCIDENTE:  6818640\r\nRESUMO:  Cliente solicita RFO para período de indisponibilidade observado em 18/07/2013 por volta das 10:30 hs\r\nSERVIÇO: MPLS\r\nDESIGNAÇÃO: P17059\r\nSINTOMA:  Indisponibilidade de serviço no período citado acima impactando produtividade de usuários.\r\nAFETAÇÃO: Disponível no momento.\r\nSEVERIDADE/IMPACTO:  ALTA\r\nPRIORIDADE:  ALTA\r\nAÇÃO/INFORMAÇÃO:  Incidente encaminhado ao time de Assurance Level 3 para averiguação.\r\n \r\nEm caso de dúvidas, favor entrar em contato com nossa central através do 0800-772-4266 ou pelo e-mail servicedesknmpt@level3.com\r\n \r\nThanks/ Saludos Cordiales / Atenciosamente,'),(817,'Migração do Riverbed da Vila do DC 6º para o Mini-DC no 3º','Resolvido',1,1,5,2,'2013-07-18 19:14:02','2013-07-22 15:12:57',0,NULL,'','Shutdwn no Riverbed de Vila (16:18)',47,'',0,'Mudança',NULL,''),(818,'Re-ativar o Riverbed em Vila pós mudança da MPLS do 6º para o 3º\r\n\r\nDeve gerar uma pequena oscilação na MPLS de Vila','Executado com Sucesso',1,1,4,2,'2013-07-18 21:17:19','2013-07-22 13:40:44',0,NULL,'','[MPLS VILA] Mudar cabo para Riverbed (19hrs)',47,'',0,'Mudança',NULL,''),(819,'\r\n\r\n14:15 - Um Técnico foi enviado para análise do armário da GVT, caso necessário procederá até o local da instalação para verificação.\r\n------------------------------------------------------------\r\n\r\nIncidente ocorreu por volta das 11:00h.\r\nReincidente às 17:00h\r\n\r\nLink normalizado, continuaremos monitorando.','Resolvido',23,1,1,1,'2013-07-18 22:06:44','2013-07-22 17:31:13',0,NULL,'','[Incidente] Falha Massiva Internet Natal - RN',47,'180720134680972 170720133890178 190720135218130   190720135314547',0,'Incidente',NULL,'19/07/13 15:44\r\n\r\nEntramos em contato junto a GVT e recebemos o retorno que o técnico local estava em campo para realizar as devidas verificações no armário.\r\n\r\nNeste momento entrei em contato com o Analista Ricardo Leão e o Link está operando em sua normalidade, ainda não possuímos um retorno da operadora informando a normalização definitiva do serviço.\r\n\r\nQualquer eventualidade favor nos informar.\r\n\r\nSeguiremos acompanhando este incidente.\r\n\r\n------------------------\r\n<ricardoleao@brq.com>\r\n\r\nAdson,\r\n \r\nRealizei contato com a GVT e me informaram que foi reaberto o chamado para a visita técnica, repassaram o prazo de 24H e especificaram a urgencia por se tratar de empresa e não ter sido atendido pelo chamado anterior.'),(820,'Pessoal,\r\n\r\nO Danilo me informou que algumas maquinas de Vargas estavam pegando IP na rede 10.2.108 percebi que o serviço DHCP do novo SQUIDVARGAS estava no ativo.. Parei o Serviço DHCP neste do novo SQUID e as maquinas voltaram a pegar IP na rede 10.2.16.0/21.\r\n\r\nPara os usuários que enfrentarem este problema devemos orienta-los a reiniciar o desktop.','Resolvido',23,1,4,3,'2013-07-19 13:00:27','2013-07-23 20:26:41',0,NULL,'','Gateway Máquinas Vargas.',47,'',0,'Incidente',NULL,'Prezados,\r\n\r\nBom dia,\r\n\r\nConforme conversamos, o Analista Hugo realizou uma análise no 8° andar e está se dirigindo ao 2° andar para ter uma métrica do impacto gerado, caso o número de chamados e ligações tenham um aumento significativo, favor informar o mais breve possível para que seja enviado um comunicado para localidade com as devidas orientações para os colaboradores..\r\n\r\nObs: As máquinas que não foram desligadas não sofreram impacto.\r\nPara os usuários que enfrentarem este problema devemos orienta-los a reiniciar o desktop.'),(821,'Devido a substituição dos no-braks do 2º andar de BV, todo o  DC da localidade ficará off de 08hs às 12hs do próximo domingo. ','Executado com Sucesso',1,1,3,5,'2013-07-19 18:48:03','2013-07-22 18:43:52',0,NULL,'','[Manutenção no-break BV]',47,'',0,'Info',NULL,''),(822,'No domingo, 21/07, será realizada uma manutenção em alguns serviços em VO. Essa janela começará às 20hs e término às 05hs do dia 22/07. Segue abaixo, o que será impactado:\r\n\r\n• BRQ Vila Olímpia - Telefonia, Link Cielo e Citibank\r\n• BRQ Boa Vista - Telefonia;\r\n• BRQ Alphaville - Telefonia;\r\n• BRQ Curitiba - Telefonia;\r\n• BRQ Panamerica Park - Telefonia; \r\n• BRQ Murano - Telefonia e acesso a Cielo;\r\n• BRQ Brasília - Telefonia;\r\n• BRQ Fortaleza - Telefonia;\r\n• BRQ Vargas - Mainframe Citibank. O mesmo poderá ser acessado remotamente pelos usuários que\r\ntenham o RemoteOffice.','Executado com Sucesso',6,1,3,2,'2013-07-19 18:51:50','2013-07-23 13:29:46',0,NULL,'','[Manutenção Rede VO]',47,'',0,'Mudança',NULL,'Links E1, Cielo e Citibank foram movidos para o andar do mini-dc.'),(823,'Hoje, os seguintes servidores Notes serão desligados:\r\n\r\nNOTESNG, DOMINOSP1, SPSERVER2','Cancelado',2,1,5,1,'2013-07-19 18:58:37','2013-07-22 13:46:31',0,NULL,'','[Desligamento servidores Notes]',47,'',0,'Info',NULL,'Mudança não pode ser realizada, pois foi verificado que o SI e as impressoras estavam utilizando os servidores Notes que iriam ser desligados como SMTP server.\r\n\r\n'),(824,'Migração dos No-breaks do DC em BV','Executado com Sucesso',1,1,3,5,'2013-07-21 10:56:19','2013-07-22 18:43:36',0,NULL,'','PARADA DC BV - 08 AS 12HRS (21/07)',47,'',0,'Mudança',NULL,''),(825,'Problemas na localidade, aguardando análise da área responsável.','Resolvido',23,1,4,5,'2013-07-22 18:05:42','2013-08-05 15:21:19',0,NULL,'','[Análise Ambiente Boa Vista]',47,'',0,'Incidente',NULL,'Network Operation Center <noc@brq.com>\r\n16:47 (2 horas atrás)\r\n\r\npara servicedesk, suportebrq, telefonia, dc \r\nPrezados,\r\n\r\nBoa Tarde,\r\n\r\nO Incidente ocorreu devido a uma falha elétrica causada por uma tomada queimada do No Break, impactando todos os serviços da localidade.\r\nTempo de indisponibilidade do Site: 15:00hrs – 15:25hrs.\r\n\r\n*Devido a migração dos No Breaks para o 6° andar, o DC está atuando apenas com um temporariamente.\r\n'),(826,'-\r\nPrezados, o serviço voltou a operar em sua normalidade as 09:25hrs. Continuamos interagindo junto ao Gerente de contas buscando a descrição da solução.\r\n\r\nEsta falha foi identificada hoje em nosso check-list de Telefonia realizado às 07:00hrs, o chamado já foi aberto junto a nossa mantenedora.','Resolvido',23,1,5,7,'2013-07-23 12:17:55','2013-08-05 15:22:04',0,NULL,'','[Incidente] Falha massiva 0800 CEF',4,'16439',1,'Incidente',NULL,'Bom dia, Senhores Estamos com os serviços abaixo indisponíveis. Necessito da verificação urgente junto a operadora. 08000815121 -> CNPJ -> 36542025000830 \r\n08006008002 -> CNPJ -> 36542025000164 \r\n\r\nAté o momento não recebemos nenhuma descrição da solução do problema.'),(827,'Links Normalizados às 11:20h, continuamos interagindo junto a operadora em busca da descrição da solução.\r\n\r\nEstamos com uma inidisponibilidade em 2 links da GVT em Marechal. \r\n\r\nOs links são a MPLS e o link de Internet dedicado (10 MB).\r\n\r\nNeste momento estamos operando via VPN automatica.\r\n\r\nA VPN com o itaú esta off devido ao problema e já orientamos as equipes a utilizarem os acessos pelos endereços de VILA.','Resolvido',23,1,5,4,'2013-07-23 12:52:50','2013-07-29 13:51:30',0,NULL,'','Indisponibilidade MPLS e Internet Marechal',4,'874264201307231018 874243201307231013',1,'Incidente',NULL,'Link:\r\nInternet: 874264201307231018   \r\nMPLS:     874243201307231013     \r\n'),(828,'Gercivan dos Santos Silva\r\n14:51 (50 minutos atrás)\r\n\r\nConseguir agendar a instalação do Link de Internet para amanha no horário comercial, passei o seu contato e do Danilo para o acompanhamento da instalação.','Aberto',23,1,5,3,'2013-07-23 18:42:21','2013-08-01 12:59:00',0,NULL,'','[Instalação] Link ADSL SBLJ',47,'',0,'Info',NULL,''),(829,'Com intuito de librar o rack antigo para enviarmos para BV, os servidores rjserver3 e rjsrvesx247 serão migrados para o rack da Dell. \r\n\r\nEssa atividade será executada das 17hs às 19hs.\r\n\r\nOBS: hostmonitor indisponível durante 30min','Executado com Sucesso',7,1,5,3,'2013-07-23 19:18:52','2013-07-29 17:25:09',0,NULL,'','[Migração servidor para rack Dell]',47,'',0,'Mudança',NULL,''),(830,'Colocar no script de logon o novo IP do servidor de inventário','Executado com Sucesso',8,1,5,1,'2013-07-23 19:20:13','2013-07-29 17:25:16',0,NULL,'','[Alteração script de logon]',47,'',0,'Mudança',NULL,''),(831,'Hoje, dia 23/07/2013, ocorrerá uma manutenção no firewall da Cielo entre 22h00 até 00h00. Consequentemente, poderá ocorrer indisponibilidade na VPN durante esse intervalo.\r\n ','Executado com Sucesso',6,1,5,11,'2013-07-23 19:21:25','2013-08-01 12:58:20',0,NULL,'','[Manutenção FW da Cielo]',47,'',1,'Info',NULL,''),(832,'Realizando verificação junto a Operadora.\r\n\r\nIncidente afetou o pop que abastece o sinal da BRQ.\r\n\r\nNo período da manhã o telefone do Mega telecom também ficou impactado.\r\n\r\nFeedback operadora: indisponibilidade durou entre 25 - 30 min.','Resolvido',23,1,5,6,'2013-07-24 18:08:25','2013-08-05 15:18:04',0,NULL,'','Degradação Internet Alphaville',7,'48318 ',1,'Incidente',NULL,''),(833,'Aberto o chamado junto a mantenedora, aguardando retorno da operadora.\r\n\r\nA GVT informou que fez uma manutenção e gostaríamos de confirmar se esta ok.\r\n\r\nDe qualquer forma a GVT ficara monitorando até amanhã de manhã para certificar possíveis quedas.\r\n\r\nSolicitante : Rafael Almeida','Normalizado',23,1,5,9,'2013-07-24 18:14:39','2013-08-05 15:18:55',0,NULL,'','Falha no tronco PP - (11) 3127-0300',5,'16465 876849201307241540',1,'Incidente',NULL,''),(834,'Aberto chamado junto a operadora para verificação. Nenhum impacto para operação.\r\nAinda não foi identificada nenhuma anormalidade pela operadora.\r\n\r\nAnalista Gercivan estará realizando o reset no roteador hoje as 21:00h.\r\n\r\nProcedimento realizado normalizando os equipamentos.','Aberto',23,7,4,2,'2013-07-29 13:34:03','2013-08-12 12:33:52',0,NULL,'','Link CITI Contingência.',2,'213874116 213964846',1,'Incidente',NULL,''),(835,' Estamos enfrentando forte lentidão, alternada por breves indisponibilidades. Em contato com a GVT fomos informados que o problema afeta toda a região Nordeste. Não existe prazo para normalização dos serviços e o problema foi constado hoje (31/07) as 8:30hrs.\r\n\r\nSegue protocolo 884917201307311025.','Aberto',23,1,5,10,'2013-07-31 15:11:04','2013-08-09 17:37:16',0,NULL,'','Lentidão Internet (GVT - Recife, Salavador e Natal)',4,'884917201307311025',1,'Incidente',NULL,''),(836,'Será criada uma VPN Ipsec com a GVT no site de Kennedy.\r\n\r\nTalvez tenhamos alguns timeouts na rede de kennedy devido a aplicação das regras de firewall. A janela para esta ativação é das 22h as 23h.','Executado com Sucesso',4,1,4,7,'2013-07-31 21:25:29','2013-08-02 21:14:28',0,NULL,'','Ativação VPN com GVT',4,'',0,'Mudança',NULL,'VPN foi criada porém não entrou em funcionamento pois deu erro na Fase 2 no equipamento da GVT.\r\n\r\nNovos testes previstos para 01/08 a partir das 22hs.'),(837,'Direcionado o trafego do GMAIL (utilizado por este link) para o link da Algar.\r\n\r\n08:30hrs: Falha no Backbone da operadora afetando todos os cliente de SP/RJ.\r\n\r\n14:30hrs: Falha continua, equipe atuando em manutenção, porém sem previsão de retorno.\r\n\r\n18:20hrs: Reparo realizado as 15:00h referente a uma falha massiva que impactou toda região de SP.','Resolvido',23,1,5,5,'2013-08-01 11:20:24','2013-08-12 12:31:26',0,NULL,'','[ Indisponivel] Link internet GVT BV',4,'886641201308010831 887767201308011413 888697201308011822',1,'Incidente',NULL,''),(838,'Ativação do Acc de wan em VO\r\n\r\nHorário: 20hs\r\n\r\nImpacto: oscilação na MPLS da localidade','Executado com Sucesso',1,1,5,2,'2013-08-01 20:24:00','2013-08-02 21:14:45',0,NULL,'','[Ativação do Acelerador de Wan]',47,'',0,'Mudança',NULL,''),(839,'Ativação do Acc de wan em BV\r\n\r\nHorário: 21:30hs\r\n\r\nImpacto: oscilação na MPLS da localidade','Executado com Sucesso',1,1,5,5,'2013-08-01 20:24:33','2013-08-02 21:14:40',0,NULL,'','[Ativação do Acelerador de Wan]',47,'',0,'Mudança',NULL,''),(840,'Regras de fw serão reorganizadas.\r\n\r\nHorário: 22hs\r\n\r\nImpacto: nenhuma, pois nenhuma regra foi alterada/adicionada','Executado com Sucesso',2,1,5,5,'2013-08-01 20:26:18','2013-08-06 13:36:42',0,NULL,'','[Reorganização da regras de FW]',47,'',0,'Mudança',NULL,''),(841,'Servidor do Book Financeiro, será migrado para BV parado que o mesmo fique operacional na semana de migração do DC de Vila.\r\n\r\nHorario indisponibilidade: das 18hs de 01/08 às 12hs do dia 03/08.\r\n\r\nImpacto: servidor indisponível durante o horário informado acima.','Executado com Sucesso',1,1,3,2,'2013-08-01 20:37:31','2013-08-06 13:36:37',0,NULL,'','[Migração do SPSERVER248]',47,'',0,'Mudança',NULL,''),(842,'Realizando abertura de chamado junto a operadora.\r\n\r\n18:00h Realizado reparo do Link pela operadora, rompimento de fibra externo.\r\n','Resolvido',23,11,5,7,'2013-08-05 17:41:55','2013-08-16 15:38:50',0,NULL,'','[Indisponibilidade] link Sascar',4,'891637201308051441',1,'Incidente',NULL,'14:40 Prazo de 4 horas.'),(843,'Atualização do ESX será realizada durante o dia.\r\n\r\nNenhum impacto, pois as VM\'s que estavam nesse servidor foram migradas para outro ESX.\r\n','Executado com Sucesso',7,1,5,3,'2013-08-06 13:56:03','2013-08-09 14:07:54',0,NULL,'','[Atualização do ESX do RJSRVESX245]',47,'',0,'Mudança',NULL,''),(844,'Hoje, às 19hs, o novo DHCP de Vila será ativado. Com isso as duas redes, ficarão funcionando em paralelo.\r\n\r\n','Executado com Sucesso',1,1,5,2,'2013-08-06 18:38:48','2013-08-08 19:26:11',0,NULL,'','[Novo DHCP Vila]',47,'',0,'Mudança',NULL,''),(845,'Hoje, das 19hs às 19:30hs, o ip do MG de vila será alterado pela Instant.\r\n\r\nImpacto: ligações entrante/saintes, ficarão indisponíveis durante 15min','Executado com Sucesso',1,1,5,2,'2013-08-06 18:41:17','2013-08-08 17:57:49',0,NULL,'','[Alteração IP Media Gateway]',5,'',0,'Mudança',NULL,'Pela manhã, a localidade ficou impossibilitada de realizar ligações.\r\n\r\nSegue explicação da Instant:\r\n\r\nUma parte da configuração do direcionamento das chamadas saintes do media gateway de vila olimpia acabou se perdendo ao reinicia-lo na parte da manhã, fazendo com que o encaminhamento para a operadora chegasse incorreto, isso não interferiu nas chamadas entrantes e nem nas chamadas dos outros sites informados nesse ticket.\r\nFoi recadastra a regra perdida, salva no gateway e validada após o restart realizado por nós.\r\n\r\nAs rotas já foram revertidas para a original conforme o Renato informou no nosso último comentário.\r\n'),(846,'Hoje, das 19hs às 20hs, as máquinas citadas acima serão migradas para o mini-dc.','Resolvido',1,1,5,2,'2013-08-06 18:43:51','2013-08-09 14:08:54',0,NULL,'','[Migração FW/Squid e Vilaserver1]',47,'',0,'Mudança',NULL,'Após vários problemas para leva-lo para o Mini DC ele foi todo refeito com um Linux \"do zero\" e os arquivos de configuração foram trazidos do que estava no ar.'),(847,'Hoje, de 18:30hs às 19hs, será realizada uma manutenção no fw/squid de BSB para liberação de espaço.','Executado com Sucesso',30,1,5,12,'2013-08-06 18:46:17','2013-08-08 17:55:22',0,NULL,'http://jira.brq.com/browse/INFR-3172','[Manutenção FW/SQUID]',47,'',0,'Mudança',NULL,''),(848,'Segue abaixo as alterações no script de logon:\r\n\r\n1 - Alterar Script de logon para as novas redes de Vargas e Vila \r\n2 - Alterar Script de logon para mapear o diretório 43DP no ambiente citrix \r\n3 - Alterar Script de logon para o ip do servidor do Xact','Executado com Sucesso',8,1,5,1,'2013-08-06 18:47:24','2013-08-08 17:51:41',0,NULL,'','[Alteração script de logon]',47,'',0,'Mudança',NULL,''),(849,'Será realizada a configuração de DHCP no squidcwb para atribuir IPs para as máquinas de contingência do HSBC\r\n\r\nExecutores: Leandro / Nelys','Executado com Sucesso',4,3,5,4,'2013-08-06 19:28:57','2013-08-08 19:26:54',0,NULL,'','Segregação lógica da Rede HSBC Contingência',47,'',0,'Mudança',NULL,''),(850,'Devido aos problemas de autenticação na localidade de Bv, alguns serviços do appliance terão que ser reiniciados hoje às 19hs.','Resolvido',17,1,5,5,'2013-08-06 20:13:04','2013-08-12 12:36:45',0,NULL,'','[Manutenção acelerador de wan]',47,'',0,'Info',NULL,'Apos um restart ele parou de funcionar, a ventoinha faz muito barulho e nada aparece na console.\r\n\r\nEquipamento será trocado no dia 09/08\r\n\r\nAppliance trocado.'),(851,'nao faz ligação externa apos a gmud de ontem','Resolvido',1,1,1,2,'2013-08-07 05:43:47','2013-08-08 17:59:35',0,NULL,'','[MEDIA GW VILA]',5,'',0,'Mudança',NULL,'Uma parte da configuração do direcionamento das chamadas saintes do media gateway de vila olimpia acabou se perdendo ao reinicia-lo na parte da manhã, fazendo com que o encaminhamento para a operadora chegasse incorreto, isso não interferiu nas chamadas entrantes e nem nas chamadas dos outros sites informados nesse ticket.\r\nFoi recadastra a regra perdida, salva no gateway e validada após o restart realizado por nós.\r\n\r\nAs rotas já foram revertidas para a original conforme o Renato informou no nosso último comentário.\r\n'),(852,'nao liga e a ventoinha faz muito barulho','Resolvido',1,1,3,2,'2013-08-07 05:49:21','2013-08-12 12:51:14',0,NULL,'','[RIVERBAD VILA]',49,'',0,'Incidente',NULL,'Equipamento substituído.'),(853,'foi todo refeito aparentemente tudo no ar.\r\nQualquer evento de rede ou acesso a internet em VILA entrar em contato com Nelys','Normalizado',2,1,5,2,'2013-08-07 05:53:36','2013-08-09 18:41:30',0,NULL,'','[SQUIDSP]',47,'',0,'Mudança',NULL,''),(854,'Sendo realizado o contato junto ainstant para verificar o problema das ligações saintes de Vila que não estão completando. ','Aberto',1,1,1,2,'2013-08-07 11:52:18','2013-08-07 11:52:36',0,NULL,'','ligações saintes de Vila',47,'',0,'Incidente',NULL,''),(855,'Estamos tendo uma degradação em nosso link.\r\nRealizado o contato junto a operadora solicitando o reparo.\r\n\r\nValidado junto a operadora, este link segue em monitoração sem nenhuma identificação de falhas no circuito.','Resolvido',23,10,5,1,'2013-08-08 11:29:05','2013-08-16 15:39:28',0,NULL,'','Degradação Link Cielo',23,'6886127',1,'Incidente',NULL,'Estamos tendo incremento de CRC na interface serial do link.'),(856,'Devido ao problema físico encontrado desde a ultima 3ª feira, o mesmo terá que ser substituído hoje às 19hs.\r\n\r\nImpacto: oscilação na rede.','Cancelado',1,1,5,2,'2013-08-08 19:58:45','2013-08-09 19:07:01',0,NULL,'','[Substituição do Acelerador de Wan]',47,'',0,'Mudança',NULL,''),(857,'Ip do Vilaserver85, será alterado hoje às 18:30hs.\r\n\r\n','Executado com Sucesso',1,1,5,2,'2013-08-08 20:02:02','2013-08-09 18:37:49',0,NULL,'','[Alteração IP servidor de impressão]',47,'',0,'Mudança',NULL,''),(858,'Uplink dos switches do 13º e 2º  serão \"migrados\" para o switch core do mini-dc.','Executado com Sucesso',1,1,5,2,'2013-08-08 20:03:50','2013-08-09 18:37:43',0,NULL,'','[Virada de uplink dos switches]',47,'',0,'Mudança',NULL,''),(859,'A telefonia de vargas entrará em manutenção hoje, das 18:30 às 19hs. Essa manutenção servirá para validar a contigência do 0800 do BNDES','Cancelado',20,1,5,3,'2013-08-08 20:06:40','2013-08-09 14:10:03',0,NULL,'','[Manutenção Telefonia]',47,'',0,'Info',NULL,'O teste de contigência do 0800 do BNDES falhou. Uma nova manutenção será marcada.'),(860,'Hoje , das 19hs às 21hs, o citrix ficará indisponível para Ativação do Citrix NS Access Gateway.\r\n\r\nApós a mudança, o ambiente deverá ser acessado pelo seguinte endereço:\r\n\r\nhttps://citrix.brq.com','Resolvido',17,1,3,1,'2013-08-08 20:10:17','2013-08-12 12:43:02',0,NULL,'','[Manutenção Citrix]',47,'',1,'Mudança',NULL,'No dia posterior a mudança, ambiente ficou instável. Apresentando a seguinte mensagem:\r\n\r\nLogin exceeds maximum allowed users.'),(861,'Procedimento será realizado as 18:30hrs, será necessário aguardar o tempo de replicação do DNS.\r\n ','Executado com Sucesso',1,1,5,2,'2013-08-08 20:52:18','2013-08-09 14:10:33',0,NULL,'','Troca de IP PrintServer VILASERVER85 VO',47,'',0,'Mudança',NULL,''),(862,'Realizado contato junto a localidade e os sites da Google estão operando em sua normalidade.\r\nEstamos analisando o motivo do alerta em nosso HostMonitor.','Resolvido',23,1,4,7,'2013-08-09 18:15:10','2013-08-15 18:18:51',0,NULL,'','Gmail.Kennedy Link GVT',30,'',0,'Info',NULL,'Confirmado que o problema estava no hostmonitor, verificado que não houve indisponibilidade no link'),(863,'Estamos em contato junto a operadora registrando um chamado para verificação do nosso link. Criticidade Alta.\r\n\r\nDesvio de rotas realizado para o link de contingência.\r\n\r\n17:00hrs Link testado e restabelecido, link continua em monitoramento pela operadora.\r\n\r\nNosso link segue em monitoração e não apresentou mais nenhuma indisponibilidade.\r\n\r\n\r\n\r\n13/08/2013 - Reincidente com o nosso Link de Internet GVT, estamos utilizando a contingência, solicitado o envio de um comunicado para toda BRQ relacionado ao impacto gerado a alguns serviços acessados de fora da BRQ.\r\n\r\n13/08/2013 - O Link voltou a operar em sua normalidade, recebemos o feedback da operadora em relação a um rompimento de fibra na região de São Paulo causando uma falha massiva.\r\n','Resolvido',23,1,5,5,'2013-08-09 18:55:23','2013-08-15 18:24:51',0,NULL,'','Instabilidade Link Internet Boa Vista.',4,'899038201308091553 902406201308131214',1,'Incidente',NULL,'O Link voltou a operar em sua normalidade, recebemos o feedback da operadora em relação a um rompimento de fibra na região de São Paulo causando uma falha massiva.\r\n\r\nDurante o período de indisponibilidade a contingência foi ativada, porém gerando impacto em relação a alguns acessos realizados de fora da BRQ.\r\nServiços: www.brq.com, https://citrix.brq.com, jira.brq.com, vpnsp.brq.com.   \r\n* A Contingência foi desativada e todos os serviços foram restabelecidos.'),(864,'Cabo uplink do 6º andar, será recuado para o 3º andar','Aberto',17,1,1,2,'2013-08-09 19:06:13','2013-08-12 12:35:36',0,NULL,'','[Virada de uplink dos switches]',47,'',0,'Mudança',NULL,''),(865,'Caso o colaborador entre em contato informando estar sem acesso ao diretório Publico, favor orientar o mesmo a realizar logoff/Logon.\r\n','Aberto',23,1,5,2,'2013-08-12 12:36:58','2013-08-15 18:22:46',0,NULL,'','Acesso ao diretório Publico em VO',47,'',1,'Info',NULL,'O Spserver1 estava desligado, por conta disto quem fez logon hoje pela manhã não mapeou o Publico.'),(866,'Área responsável verificando lentidão para completar as ligações.\r\n\r\nFoi identificado um problema de configuração relacionado ao tamanho máximo da tabela MAC do Gateway de BV, gerando dificuldade de \"chegar\" a outra localidade.\r\n\r\nPara resolver, aumentamos o limite máximo desta tabela. \r\n\r\nO ambiente continua em monitoração.','Resolvido',23,1,5,5,'2013-08-12 13:39:38','2013-08-16 15:40:06',0,NULL,'','Lentidão Telefonia para completar ligacoes',47,'',1,'Incidente',NULL,'Nelys David dos Santos:\r\n\r\nHoje pela manha, tivemos alguns eventos \"estranhos\" em Boa Vista.\r\nComeçou com alguns telefones não funcionado.\r\nNa verdade, foi o Firewall que estava incapaz de adicionar mais MAC-ADDRESS em sua tabela ARP.\r\nDesta forma ele simplesmente \"ignorava\" algumas máquinas na rede.\r\nAs máquinas que já estavam na tabela, continuavam funcionando e as que ficam em \"silêncio\" por muito tempo não conseguiam mais sair da da sua própria rede.\r\nO problema, aparentemente foi resolvido, mais ainda estamos monitorando.\r\nA resolução está em:\r\nhttp://jira.brq.com/browse/INFR-3177'),(867,'Erro para executar as aplicações do Citrix.\r\n\r\n- Unable to launch your application.\r\n- Error: Login exceeds maximum allowed users.\r\n\r\nÁrea responsável está atuando na solução do problema.\r\n\r\n13/08/2013 - O acesso as aplicações do Citrix foram restabelecidas o operam normalmente.','Resolvido',23,1,5,1,'2013-08-12 14:41:21','2013-08-15 18:26:37',0,NULL,'','Erro Ambiente Citrix.',47,'',1,'Incidente',NULL,'Acionado Analista Citrix, aguardando chegada do mesmo a BRQ.'),(868,'Chamado relacionado ao aumento de disco do servidor 073354.\r\nMaquina será desligada para o processo do aumento do disco.','Resolvido',31,1,5,9,'2013-08-12 20:23:27','2013-08-15 18:27:24',0,NULL,'','[Servidor ppserver7]',47,'073354',0,'Info',NULL,'Efetuada a expansão do disco conforme solicitado no chamado 073354. '),(869,'Olá,\r\n\r\nInformamos que HOJE, 12 de agosto, será realizada uma manutenção elétrica emergencial na \r\nBRQ Marechal, das 22hs às 22:40h.\r\n\r\nEm função disso, os seguintes serviços ficarão indisponíveis nesse período: acesso à internet, \r\nclientes, e-mail, telefonia, VPN e outros.\r\n\r\nO Data Center também ficará indisponível e não haverá acessos originados ou recebidos \r\npara a BRQ Marechal.\r\n\r\nOBS: Devido a falta de energia elétrica, desligue o seu equipamento para evitar danos e perda de dados. \r\n\r\nEm caso de dúvidas, entre em contato pelo e-mail servicedesk@brq.com.','Executado com Sucesso',23,1,5,4,'2013-08-12 22:11:25','2013-08-13 17:52:34',0,NULL,'','Manutenção elétrica emergencial, 22hs às 22:40hs.',47,'',1,'Mudança',NULL,'DC não precisou ser desligado, os nobreaks aguentaram todo o período da atividade. Atividade esta que durou 30min.\r\n\r\n'),(870,'Identificamos oscilações na MPLS de Boa Vista. Foi aberto um chamado junto a operadora para que seja efetuada a análise. \r\n\r\n\r\nConfiguração realizada pela operadora eliminando o problema de perda de pacotes. Link operando normalmente. \r\n\r\n','Resolvido',23,1,5,5,'2013-08-13 19:47:20','2013-08-19 18:21:05',0,NULL,'','[Perda de pacotes] MPLS BOA VISTA',23,'6902251',0,'Incidente',NULL,'INCIDENTE:  6902251\r\nRESUMO: Perda de pacotes\r\nSERVIÇO: MPLS.\r\nDESIGNAÇÃO: P16288\r\nTECNOLOGIA DE FALHA: Cisco 1841\r\nSINTOMA: Queda de conexão\r\nAFETAÇÃO: Localidade indisponível\r\nSEVERIDADE/IMPACTO: CRÍTICO\r\nPRIORIDADE: ALTA\r\nAÇÃO: Detectamos perdas de pacotes entre o router CPE e o Edge.\r\n'),(871,'Estamos em contato junto a operadora realizando as devidas verificações em nosso Link.  Prazo de retorno do contato entre 30 - 40 minutos.\r\nManteremos todos informados.\r\n\r\nAlerta: Cielo Detectado: 15/08/13  10:14:42 hrs.\r\n\r\n15/08/2013 13:18 - Continuamos interagindo junto a operadora, recebemos o retorno que a mesma está passando por uma falha massiva afetando as regiões de SP e RJ, o chamado foi escalonado e continuaremos acompanhando este incidente.\r\n\r\n15/08/2013 14:34 -  O circuito não está mais down e sim com perda de pacotes, erros de CRC e com 30 ruídos por minuto. Solicitado urgência para a operadora.\r\n\r\n16/08/2013 01:59 - Efetuada a manutenção pela operadora no link com sucesso\r\n\r\n16/08/2013 09:00 - Link operacional\r\n\r\n','Resolvido',28,10,5,1,'2013-08-15 13:23:11','2013-08-19 18:21:39',0,NULL,'','[Incidente] Indisponibilidade Ambiente CIELO',23,'6909254',1,'Incidente',NULL,''),(872,'Atualização do ESX para versão 5.0','Executado com Sucesso',7,1,4,3,'2013-08-15 14:34:12','2013-08-19 17:46:11',0,NULL,'','Manutenção RJSRVESX246',35,'',0,'Mudança',NULL,''),(873,'O Link dedicado ao Google na localidade de Vila Olímpia apresentou falha as 15:30hrs, as rotas foram alteradas e no momento os sites da Google estão saindo pela link da Level(3).\r\n\r\nRealizamos o contato junto a operadora e o chamado: 907003201308151549 foi registrado com o prazo de retorno para contato de 4 horas.\r\n\r\nConforme contato com a operadora o link já esta normalizado. ','Resolvido',23,1,5,2,'2013-08-15 18:45:02','2013-08-19 18:23:36',0,NULL,'','Link.Sites.Google.VO',4,'907003201308151549',1,'Incidente',NULL,''),(874,'Foi verificado pela Columbia, que a versão do SO do Acc que está em VIla, é diferente dos demais. \r\n\r\nPor isso foi agendada essa atualização.\r\n\r\nAtividade em conjunto com Nelys, Edson e Mansur.\r\n\r\nPeriodo: 20hs às 22hs\r\n\r\nImpacto: pequena oscilação na MPLS da localidade','Executado com Sucesso',2,1,5,2,'2013-08-15 20:24:12','2013-08-19 13:45:36',0,NULL,'','[Atualização do Acelerador de Wan]',47,'',0,'Mudança',NULL,'Acelerador foi atualizado. \r\n\r\nPorém no dia seguinte, o mesmo erro de autenticação voltou a ocorrer pela 3ª vez.\r\n\r\nCarlinhos aplicou uma regra no acc para resolução do problema.'),(875,'ativação da interface da rede do storage de BV\r\n\r\nHorario: 19hs\r\n\r\nImpacto: oscilação na rede da localidade','Resolvido',1,1,5,5,'2013-08-15 20:26:31','2013-08-19 17:48:43',0,NULL,'','[Ativação interface storage]',47,'',0,'Mudança',NULL,'Atividade será executada hoje, 16/08, às 20hs.\r\n\r\nPara ativação da interface, foi negociado com o CA a porta de um link que não estava sendo utilizado por 15 dias até que o FW da localidade seja reiniciado.'),(876,'Para termos um backup do citrix, será feito um backup do Labcitrix - ip 10.2.0.91\r\n\r\nImpacto: nenhum','Executado com Sucesso',17,1,5,2,'2013-08-15 20:48:27','2013-08-16 14:23:44',0,NULL,'','[Clone Labcitrix]',47,'',0,'Mudança',NULL,''),(877,'Para termos um backup do FWBV, hoje será feito um backup do mesmo\r\n\r\nImpacto: nenhum','Executado com Sucesso',1,1,5,5,'2013-08-15 20:49:08','2013-08-16 14:23:40',0,NULL,'','[Clone FWBV]',47,'',0,'Mudança',NULL,''),(878,'Com intuito de liberar uma maquina DELL para migração do VOIP em CWB, alguns ambientes terão que ser migrados para outro ESX. Hoje das 22hs às 23hs, o spserver248 será migrado\r\n \r\nImpacto: Book financeiro indisponivel','Executado com Sucesso',1,1,3,5,'2013-08-15 20:57:57','2013-08-19 13:45:53',0,NULL,'','[Migração do SPSERVER248]',47,'',0,'Mudança',NULL,'Testes validados pelo Elton da equipa do Willian Leite'),(879,'14:30hrs - Estamos com uma instabilidade no site de Kennedy, realizamos o contato junto ao Analista da localidade e o mesmo está realizando uma análise em relação ao incidente.\r\nManteremos todos informados.\r\n\r\nA localidade de Kennedy passou por um Time Out em torno de 3 minutos impactando todos os serviços devido a um incidente relacionado ao restart inesperado do Switch Core. Seguiremos monitorando o ambiente.\r\n\r\nAmbiente operacional','Resolvido',23,1,5,7,'2013-08-15 21:39:36','2013-08-23 20:05:00',0,NULL,'','[Incidente] Instabilidade Ambiente Kennedy.',47,'',1,'Incidente',NULL,''),(880,'Estamos interagindo junto as duas mantenedoras verificando o problema intermitente em relação as ligações saintes da localidade de Marechal.\r\n\r\nAnálise realizada pela mantenedora, ocorreu uma instabilidade momentânea, a mesma continua verificando o ocorrido.\r\n\r\n20/08/2013 - 17:45 - Foi efetuada a troca de um dos modems e o ambiente continua em monitoração.\r\n\r\n21/08/2013 - 08:40 - Realizados testes com sucesso, será efetuado outro teste no período da tarde.\r\n\r\nBRQ Marechal - Manutenção Telefonia, HOJE, 20hs às 21hs\r\n\r\n21/08/2013 - 13:47 - Foi habilitada uma rota de contingência no site de Marechal para a realizações de ligações externas. Esta já está ativa, e sua utilização é totalmente transparente ao usuário. ','Aberto',23,1,1,4,'2013-08-16 16:14:52','2013-08-22 13:14:02',1,NULL,'','[Análise] Ligações Saintes Marechal.',5,'16668 910271201308191213 ',1,'Incidente',NULL,'Chamado 910271201308191213 aberto na operadora GVT para verificar o link. Este encontra-se em observação pela mesma.\r\n\r\nChamado InstantTicket 16668 - Ramais pontuais indisponíveis, ambiente em monitoração.\r\n\r\nCíntia Pesse Ribas (responsável pela GVT) foi acionada.\r\n\r\n20/08/2013 - 17:45 - Conforme comunicado da GVT,foi efetuada a troca de um dos modems e o ambiente continua em monitoração\r\n\r\n21/08/2013 - 08:40 - Realizado teste com a colaboradora Juliana da recepção (ramal 418002) para ligação externa com sucesso.Será efetuado outro teste no período da tarde.\r\n\r\n21/08/2013 - 13:47 - Foi habilitada uma rota de contingência no site de Marechal para a realizações de ligações externas. Esta já está ativa, e sua utilização é totalmente transparente ao usuário. \r\n\r\n\r\n'),(881,'Foram verificados alguns erros nos pontos de rede em Marechal. \r\nPara os colaboradores que entrarem em contato favor repassar o chamado para a localidade de Marechal.\r\n\r\nNão foram mais relatados problemas nos pontos de rede. Ambiente estável.','Resolvido',23,1,5,4,'2013-08-19 13:51:16','2013-08-23 19:30:53',0,NULL,'','[Incidente] Problemas pontuais em pontos de rede - Marechal ',47,'',1,'Info',NULL,''),(882,'Informo que o chamado foi aberto junto a Level(3): 6928807, prazo de retorno para contato de uma hora.\r\n18:40 h - No momento o Alerta não está mais em alarme, aguardando retorno da operadora.\r\n19:40 h - O serviço encontra-se disponível novamente. foi efetuada um manutenção na rede de fibra óptica.','Resolvido',23,1,5,8,'2013-08-20 20:57:34','2013-08-23 19:29:43',0,NULL,'','[Indisponibilidade MPLS] C.FORMPLSROUTER.LAN0',23,'6928807',0,'Incidente',NULL,'A interrupção do serviço estava relacionada a um rompimento de fibra na rede da last mile Oi.'),(883,'Hoje será realizada uma manutenção no RM e o sistema ficará fora do ar entre 19h e 20h.\r\n\r\n22-08-2013 - 09:38 - Verificado com o pessoal do DP-RJ e o sistema ainda esta instável pelo acesso ao citrix.\r\n\r\n22-08-2013 - 14:44 - Verificado com o pessoal do DP-RJ e o sistema esta operacional.','Nao Resolvido',23,1,5,1,'2013-08-21 17:30:13','2013-08-23 17:36:00',0,NULL,'','[Manutenção RM]',19,'',1,'Info',NULL,'Mudança não foi realizada, pois deu erro de licença no servidor de SP.\r\n\r\nSerá aberto um chamado na TOTVS, para verificação do erro.\r\n\r\nAssim que possível, marcaremos uma nova data.'),(884,'Devido aos problemas em relação a ligação sainte que vem ocorrendo na localidade, a GVT precisa realizar uma manutenção na rede para identificar o problema.\r\n\r\nEssa manutenção será realizada hoje, entre 20hs e 21hs. Durante esse período, pequenos periodos de indisponibilidade podem ser apresentadas.','Aberto',15,1,5,4,'2013-08-21 18:29:32','2013-08-22 17:41:33',1,NULL,'','[Manutenção telefonia Marechal]',4,'',0,'Info',NULL,'Nenhum problema foi encontrado pela equipe tecnica da GVT.\r\nA mesma informou que o problema seria interno.\r\n\r\nFoi agendada uma audioconfêrencia entre GVT, Instant e BRQ.\r\n\r\n'),(885,'Estamos com uma falha de telefonia/dados em Natal. Ligações originadas para o 0800 (SD - Neoenergia) também não estão sendo completadas, retornando sinal de ocupado.\r\n\r\n21/08/2013 - 15:44 - verificado com  Ricardo Dos Santos Leão Junior que o ambiente neste instante esta estável. \r\n\r\n22/08/2013 - 09:17 - verificado com  Ricardo Dos Santos Leão Junior que o ambiente neste instante esta estável.Faremos uma nova verificação na parte da tarde para validar o ambiente. \r\n\r\n22/08/2013 - 16:55 - verificado com  Ricardo Dos Santos Leão Junior que o ambiente neste instante esta estável.Porém tivemos uma instabilidade com duração de 10 minutos no período da tarde \r\n\r\n23/08/2013 - 10:00 - verificado com  Ricardo Dos Santos Leão Junior que o ambiente neste instante esta estável. Faremos uma nova verificação na parte da tarde para validar o ambiente. \r\n\r\n23/08/2013 - 15:20 - verificado com  Ricardo Dos Santos Leão Junior que o ambiente neste instante esta estável. O ambiente continua em monitoração.','Aberto',23,1,5,14,'2013-08-21 18:47:57','2013-08-23 19:32:16',1,NULL,'','[Indisponibilidade] link GVT Natal - RN ',4,'',1,'Info',NULL,''),(886,'Hoje, serão desligados os servidores Domino, NOTESNG/Websp e DOMINOSP1/Websp.\r\n\r\nCaso algum usuário reclame que o Notes parou de funcionar, é por que ele não tem o documento de conexão para os outros servidores.\r\nApenas criem um documento de conexão para o Moebius usando o nome internet dele \"moebius.brq.com\".\r\nPara isso, apertem \"Ctrl + O\" no campo \"Look in\" coloquem \"moebius.brq.com\" e de enter.\r\nNão deve ser necessário, mas encontrem o caminho da base que ele precisa usar.','Executado com Sucesso',2,1,5,1,'2013-08-21 21:06:49','2013-08-22 13:49:12',1,NULL,'','[Desligamento dos servidores Lotus Domino]',47,'',0,'Mudança',NULL,''),(887,'Será feito ativação da MPLS Murano.','Executado com Sucesso',2,1,5,11,'2013-08-22 19:50:28','2013-08-23 17:35:27',1,NULL,'','Ativação link MPLS MURANO',23,'',0,'Mudança',NULL,'.');
